Prompt realizando la carga de datos de biometricos

declare

v_firma varchar2(100);
v_foto varchar2(100);
v_dedo varchar2(100);

v_seq_biometricos number;

begin
	dbms_output.put_line('Insertando datos');
	for i in 1..2600 loop
		select seq_biometricos.nextval into v_seq_biometricos from dual;
		v_firma := '/home/Daniel/Desktop/BDA/Proyecto/Blobs/firma_'||round(dbms_random.value(1,5))||'.jpg';
		v_foto := '/home/Daniel/Desktop/BDA/Proyecto/Blobs/foto_'|| round(dbms_random.value(1,5))||'.jpg';
		v_dedo := '/home/Daniel/Desktop/BDA/Proyecto/Blobs/dedo_'|| round(dbms_random.value(1,5))||'.jpg';
			values (v_seq_biometricos,read_blobs(v_firma),read_blobs(v_foto),
				read_blobs(v_dedo),read_blobs(v_dedo),read_blobs(v_dedo),read_blobs(v_dedo),read_blobs(v_dedo),
				read_blobs(v_dedo),read_blobs(v_dedo),read_blobs(v_dedo),read_blobs(v_dedo),read_blobs(v_dedo),
				v_seq_biometricos);
	end loop;
end;
